                function pop_close_function() {
                    jQuery(".back--to--button").click(function(){
                    portfolio_Scale.reverse();
					jQuery(".hSec").css("z-index", "1000");	
                    gsap.delayedCall(1, function(){    
                    circle_wrapper_animate.timeScale(1).reverse();    
                    }); 
                    circle_animate.reverse();
                    if(!tl_new.isActive()){
                        gsap.delayedCall(1, function(){    
                            tl_new.timeScale(1).play();
                            
                            });
                        
                    }
                });
                }

