;jQuery(function ($) {
  var $fixedSection = $('.portfolio--category--fixed');
  var $firstSection = $('.verticle--scroll--section');
  var $secondSection = $('.portfolio--single--main');

  if ($fixedSection.length && ($firstSection.length || $secondSection.length)) {
    $(window).on('scroll', function () {
      var makeRelative = false;

      if ($firstSection.length) {
        var firstRect = $firstSection[0].getBoundingClientRect();
        if (firstRect.bottom <= window.innerHeight) {
          makeRelative = true;
        }
      }

      if ($secondSection.length) {
        var secondRect = $secondSection[0].getBoundingClientRect();
        if (secondRect.bottom <= window.innerHeight) {
          makeRelative = true;
        }
      }

      // Mobile (<=768px)
      if (window.innerWidth <= 768) {
        if (makeRelative) {
          $fixedSection.css({
            'position': 'relative',
            'bottom': '0',
            'width': ''
          });
        } else {
          $fixedSection.css({
            'position': 'fixed',
            'bottom': '0',
            'width': '100%'
          });
        }
      } 
      // Desktop (>768px)
      else {
        if (makeRelative) {
          $fixedSection.css({
            'position': 'relative',
            'bottom': '0',
            'width': ''
          });
        } else {
          $fixedSection.css({
            'position': 'fixed',
            'bottom': '0',
            'width': '100%'
          });
        }
      }
    });
  }
});
