		jQuery(document).on("click",".ptb_pagenav a", function(e){
	e.preventDefault();
	var link = jQuery(this).attr('href');
	var data = {};
	var active_tab = '';
	data['action'] = 'get_profile_next';
	data['get_link'] = link;
	jQuery.ajax({
		url:'https://delimp.com/wp-admin/admin-ajax.php',
		method:'post',
		data:data,
		dataType:'json',
		beforeSend: function(){
		console.log(data);
		jQuery(".elementor-tabs .elementor-tabs-wrapper div").each(function(index,value){
		if(jQuery(value).hasClass("elementor-active")){
			active_tab = jQuery(value).attr("aria-controls");
		}
		});
		},
		success: function(json){
			jQuery(".elementor-tabs-content-wrapper").remove();
			jQuery(".elementor-tabs").append(json.main_description);
			jQuery("#"+active_tab).addClass("elementor-active").css("display","block");
		}
	});
})


jQuery(".elementor-widget-container .elementor-tabs .elementor-tabs-wrapper div").click(function(e){
	var active_tab = jQuery(this).attr("aria-controls");
	console.log("active_tab: "+active_tab);
	jQuery(".elementor-tab-content").removeClass("elementor-active").css("display","none");
	jQuery("#"+active_tab).addClass("elementor-active").css("display","block");
});
